import "./App.css";
import Home from "./components/Home";
import Login from "./auth/Login"
// import { JobProvider } from "./components/JobsContext";
import { Auth0Provider } from "@auth0/auth0-react";

function App() {
  return (
    <Auth0Provider>
      <div className="App">
        <Home />
        <Login/>
      </div>
    </Auth0Provider>
  );
}

export default App;
